- Players "click to sit" and take on the role of Red or Blue player.&nbsp;
- Click on the BOARD button to choose board A or B. The game will reset and the Map will change based on your selection.&nbsp;
- On your turn, click on the ROLL button and drag any number of dice to the 2 different offer areas (light grey boxes below the dice). One of the boxes will be prepopulated with a card. Feel free to move this card to either box as you are dividing up your dice.&nbsp;<div><b>**NOTE** </b>Starting on the 8th round, the card will not change. This is a function of the game.&nbsp;&nbsp;</div><div>- When the offers are complete, each player, starting with the person who did not roll, will select and utilize the dice and card (if any) in any order they like. Gift box symbols are used to check gift boxes on your side of the player area. Shamrocks are used to fill circles on the right side of the screen, and dice with numbers are used to fill hex cells on the map.<div><div>- Drag the dice with number values to your hex-cell selection (hex-cells can also be clicked on to display X or any other values). All number values are color coded and must be placed in that color region. The 0's are neutral colors and can be placed in any color region.</div><div><b>**NOTE** </b>You can usually only place a number on the board if it is adjacent to another <b>number </b>(not X) <i>you</i> have previously placed. The exception to this is to use an "<b>anthill</b>" by checking one of the 2 "Ant" boxes you have on your side of the board. This allows you to select <b>any</b>&nbsp;space on the board to place a die with a number.&nbsp;For each players first turn, they will likely need to use an "ant" box to take a turn, but there could be exceptions, such as the card that allows you to place a 0-value anthill anywhere on the board, or if you cross off enough gift boxes to place a 0 or 3 value value anthill anywhere. These are denoted by the 0 and 3 in a hex with an ant next to them.&nbsp;</div><div><img alt="" src="data:image/png;base64,"></div><div>&nbsp;- If you cover a <b>Cake</b> symbol on the map with a number (not an X), click the white checkbox on your side of the player area on the Cake Track to track how many cakes you've crossed off this game. When you reach a box with a +1, 2, or 3, increase your score immediately by this number by hitting the + button next to your name.&nbsp;</div><div><img alt="" src="data:image/png;base64,"></div><div><div>- If you cover a <b>Gift </b>symbol<b>&nbsp;</b>on the map&nbsp;<span style="color: var(--overlayFontColor);">with a number (not an X)</span><span style="color: var(--overlayFontColor);">, or acquire a die with a gift, click on any of the check boxes</span><b style="color: var(--overlayFontColor);">&nbsp;</b><span style="color: var(--overlayFontColor);">in the multiple gift check box areas. If you've filled one of these selections by crossing off 2, 3, 4, or 5 check boxes, you immediately gain the benefit listed.&nbsp;</span></div><div><img alt="" src="data:image/png;base64,"><span style="color: var(--overlayFontColor);"></span></div><div>- If you acquire a die with a <b>Shamrock</b>, immediately click on the corresponding circle on the right side of the screen which aligns with the color shamrock you've taken.</div><div><b>**NOTE** </b>Each player starts with 2 circles filled in on each shamrock.</div><div><img alt="" src="data:image/png;base64,"></div><div>&nbsp;- When both players have taken a turn, click ROLL and all dice will be recalled and a new card drawn. It is now the next players turn to divide the dice and cards.</div></div><div><br></div><div><b>GAME END</b></div><div>- The game ends at the end of a round when any of the following conditions are met:</div><div>1. All hexes within a color region on the map are completely filled in with numbers or Xs.</div></div></div><div>2. All 12 cakes are crossed off on the map.</div><div>3. The last shamrock circle is filled in for a region.</div><div><br></div><div>Points are tallied by adding the # values for each player in each region. Whoever has the higher value will score points equal to the number of circles they have in their shamrock of that color. If players are tied, nobody scores points.&nbsp;</div><div><br></div><div>Whoever has the most points wins. If<span style="color: var(--overlayFontColor);">&nbsp;tied, whoever has the most cakes crossed off wins. If still tied, the player who caused the end of the game to occur, wins.&nbsp;</span></div>
